import { View, Text, StyleSheet } from "react-native";

const GameScreen = () => {
  return (
    <View>
      <Text>Opponent's Guess</Text>; Guess
      <View>
        <Text>Higher or lower?</Text>+ -
      </View>
      <View>LOG ROUNDS</View>
    </View>
  );
};

export default GameScreen;

const styles = StyleSheet.create({});
